import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ isLogin, path, element }) => {
  return isLogin ? <Route path={path} element={element} /> : <Navigate to="/LoginLayout" />;
};

export default PrivateRoute;
